// components/Admin.js
import React from "react";
import Sidebar from "./SideBar";
import DashboardContent from "./DashBoardContent";
import Header from "./Header";

const Admin = () => {
  return (
    <div className="dashboard-container">
      <Header />
      <div className="main-content">
        <Sidebar />
        <DashboardContent />
      </div>
    </div>
  );
};

export default Admin;
